import React from 'react';

const LetterSpacing = () => {
  const letterSpacings = [
    { id: 104, classTitle: 'lsDef', classValue: 'default' },
    { id: 101, classTitle: '', classValue: 'lsSM' },
    { id: 102, classTitle: 'Medium', classValue: 'lsMD' },
    { id: 103, classTitle: 'Large', classValue: 'lsLG' },
  ];

  return (
    <>
      <div className='containerFluidSM containerSM-lg'>
        <div className='sectionTitle ffStyled primary'>
          <h5 className='fsH5 pb2'>Letter Spacing</h5>
        </div>

        <div className='row ffStyled fwBold primary mb1'>
          <div className='col6 col3-xs col3-sm'>Classes</div>
          <div className='col6 col9-xs col9-sm'>Appearances</div>
        </div>

        {letterSpacings.map((ls) => (
          <div key={ls.id} className='row alignCenter mb1'>
            <div className='col6 col3-xs col3-sm fwBold'>
              <p className='fsSM'>.{ls.classValue}:</p>
            </div>

            <div className='col6 col9-xs col9-sm'>
              <div className='row flexColumn flexRow-xs'>
                <div className='col12 col4-xs col3-md'>
                  <h6 className={`fsMD ffDef ${ls.classValue}`}>
                    {ls.classTitle}
                  </h6>
                </div>
                <div className='col12 col4-xs col3-md'>
                  <h6 className={`fsMD ffStyled ${ls.classValue}`}>
                    {ls.classTitle}
                  </h6>
                </div>
                <div className='col12 col4-xs col3-md'>
                  <h6 className={`fsMD ffAccent ${ls.classValue}`}>
                    {ls.classTitle}
                  </h6>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default LetterSpacing;
